INSERT INTO `ms_sub_klasifikasi` (`id`, `kode`, `id_klasifikasi`, `deskripsi`, `lingkup_pekerjaan`, `flag`) VALUES
(1, 'BG001', '6', 'Jasa Pelaksana Untuk Konstruksi Bangunan Hunian Tunggal dan Koppel ', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan, serta peningkatan) dari bangunan perumahan yang terdiri dari satu atau dua tempat tinggal maksimum 2 lantai.', 0),
(2, 'BG002', '6', 'Jasa Pelaksana Untuk Konstruksi Bangunan Multi atau Banyak Hunian ', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan serta peningkatan) dari bangunan perumahan bertingkat tinggi yang lebih dari 2 lantai.', 0),
(3, 'BG003', '6', 'Jasa Pelaksana Untuk Konstruksi Bangunan Gudang dan Industri ', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan, peningkatan  serta  pekerjaan  renovasi)  dari  bangunan  gudang  dan  bangunan Industri.', 0),
(4, 'BG004', '6', 'Jasa Pelaksana Untuk Konstruksi Bangunan Komersial ', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan, peningkatan serta pekerjaan renovasi) dari bangunan dengan tujuan komersial seperti bangunan perkantoran, bangunan BANK, Garasi parkir, stasiun pengisian bahan  bakar,  terminal  kendaraan  umum  serta  bangunan  stasiun  kereta  api, bangunan pusat perbelanjaan.', 0),
(5, 'BG005', '6', 'Jasa Pelaksana Untuk Konstruksi Bangunan Hiburan Publik ', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan, peningkatan  serta  pekerjaan  renovasi)  dari  bangunan  hiburan  publik  seperti bioskop, hall konser, nightclubs.', 0),
(6, 'BG006', '6', 'Jasa Pelaksana Untuk Konstruksi Bangunan Hotel, Restoran, dan Bangunan Serupa Lainnya ', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan, peningkatan serta pekerjaan renovasi) dari hotel, motel, restoran dan bangunan yang serupa lainnya.', 0),
(7, 'BG007', '6', 'Jasa Pelaksana Untuk Konstruksi Bangunan Pendidikan', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan,', 0),
(8, 'BG008', '6', 'Jasa Pelaksana Untuk Konstruksi Bangunan Kesehatan', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan, peningkatan serta pekerjaan renovasi) dari bangunan kesehatan seperti rumah sakit dan sanotarium.', 0),
(9, 'BG009', '6', 'Jasa Pelaksana Untuk Konstruksi Bangunan Gedung Lainnya', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan, peningkatan  serta  pekerjaan  renovasi)  dari  bangunan  lainnya  seperti,  rumah ibadah dan penjara.', 0),
(10, 'SI001', '7', 'Jasa Pelaksana Untuk Konstruksi Saluran Air, Pelabuhan, Dam, dan Prasarana Sumber Daya Air Lainnya', '1. Pekerjaan pelaksanaan pembangunan, pemeliharaan dan perbaikan bangunan bendungan (dam), bendung (weir), embung, pintu air, talang, check  dam,  tanggul  dan  saluran  pengendali  banjir  termasuk  drainase perkotaan beserta bangunan pelengkapnya, tanggul laut, krib, viaduk dan sarana dan/atau prasarana sumber daya air lainnya; 2.   Pekerjaan   pelaksanaan   pembangunan,  pemeliharaan   dan   perbaikan konstruksi jaringan saluran air, sistem irigasi (kanal), reservoir (waduk) dan drainase irigasi; dan 3.   Pekerjaan   pelaksanaan   pembangunan,  pemeliharaan   dan   perbaikan dermaga, sarana pelabuhan, penahan gelombang dan sejenisnya. Termasuk konstruksi jalan air atau terusan, pelabuhan dan sarana jalur sungai, dok (pangkalan), lock (panama canal lock, Hoover Dam) dan lain-lain.', 0),
(11, 'SI002', '7', 'Jasa Pelaksana Konstruksi Instalasi Pengolahan Air Minum dan Air Limbah Serta Bangunan Pengolahan Sampah.', 'Pekerjaan pelaksanaan pembangunan, pemeliharaan dan perbaikan instalasi pengolahan  air  minum,  bangunan  menara  air  dan  reservoir  air  beserta bangunan  pelengkap  air  minum  lainnya,  instalasi  pengolahan  air  limbah beserta   bangunan   pelengkap   air   limbah   lainnya,   bangunan   Tempat Pembuangan Akhir Sampah beserta bangunan pelengkapnya.', 0),
(12, 'SI003', '7', 'Jasa Pelaksana Untuk Konstruksi Jalan Raya (kecuali Jalan layang), jalan, rel kereta api, dan landas pacu bandara', 'Pekerjaan pelaksanaan pembangunan, peningkatan, pemeliharaan dan perbaikan jalan, jalan raya (kecuali Jalan layang) dan jalan tol termasuk juga jalan untuk pejalan kaki, rel kereta api, dan landas pacu bandara.', 0),
(13, 'SI004', '7', 'Jasa Pelaksana Konstruksi Pekerjaan Jembatan, Jalan Layang, Terowongan dan Subways', '1. Pekerjaan pelaksanaan pembangunan, peningkatan, pemeliharaan dan perbaikan jembatan dan jalan layang; dan 2.Pelaksanaan pembangunan, peningkatan, pemeliharaan dan perbaikan bangunan terowongan di bawah permukaan air, di bukit atau pegunungan dan di bawah permukaan tanah.', 0),
(14, 'SI005', '7', 'Jasa Pelaksana Untuk Konstruksi Perpipaan Air Minum Jarak Jauh ', 'Pekerjaan pelaksanaan instalasi, peningkatan, pemeliharaan dan perbaikan jaringan pipa untuk distribusi air bersih jarak jauh antar pulau dan atau di bawah permukaan laut.', 0),
(15, 'SI006', '7', 'Jasa Pelaksana Untuk Konstruksi Perpipaan Air Limbah Jarak Jauh ', 'Pekerjaan pelaksanaan instalasi, peningkatan, pemeliharaan dan perbaikan jaringan pipa untuk distribusi air limbah jarak jauh antar pulau dan atau di bawah permukaan laut.', 0),
(16, 'SI007', '7', 'Jasa Pelaksana Untuk Konstruksi Perpipaan  Minyak dan Gas Jarak Jauh', 'Pekerjaan pelaksanaan instalasi, peningkatan, pemeliharaan dan perbaikan pipa jaringan untuk distribusi minyak dan gas jarak jauh antar pulau dan atau di bawah permukaan laut.', 0),
(17, 'SI008', '7', 'Jasa Pelaksana Untuk Konstruksi Perpipaan Air Minum Lokal ', 'Pekerjaan pelaksanaan instalasi, peningkatan, pemeliharaan dan perbaikan jaringan pipa untuk distribusi air minum yang bersifat lokal dan untuk jarak yang dekat.', 0),
(18, 'SI009', '7', 'Jasa Pelaksana Untuk Konstruksi Perpipaan Air Limbah Lokal ', 'Pekerjaan pelaksanaan instalasi, peningkatan, pemeliharaan dan perbaikan jaringan pipa untuk distribusi air limbah yang bersifat lokal dan untuk jarak yang dekat.', 0),
(19, 'SI010', '7', 'Jasa Pelaksana Konstruksi Perpipaan Minyak dan Gas Lokal', 'Pekerjaan pelaksanaan instalasi, peningkatan, pemeliharaan dan perbaikan jaringan pipa untuk distribusi air minyak dan gas yang bersifat lokal dan untuk jarak yang dekat.', 0),
(20, 'SI011', '7', 'Jasa pelaksana Konstruksi bangunan stadion untuk olahraga outdoor', 'Pekerjaan pelaksana untuk konstruksi stadium dan olahraga lapangan yang biasanya  dimainkan  di  tempat  terbuka  (open  air)  seperti  sepakbola, baseball, rugby, lintasan balap mobil dan motor serta lintasan pacu kuda.', 0),
(21, 'SI012', '7', 'Jasa Pelaksana Konstruksi Bangunan Fasilitas Olah Raga Indoor dan Fasilitas Rekreasi', 'Pekerjaan pelaksana untuk olahraga lainnya serta instalasi fasilitas rekreasi, olah raga yang dimaksud lebih banyak merupakan olahraga indoor yang  taman rekreasi.basket, hockey, lapangan tenis, hall senam, dan ring tinju dan fasilitasmembutuhkan ruang yang lebih kecil untuk penonton seperti lapangan', 0),
(22, 'MK001', '8', 'Jasa pelaksana konstruksi pemasangan pendingin udara (Air Conditioner), pemanas dan ventilasi', 'Pekerjaan pemasangan dan perawatan yang meliputi pemanasan elektrik maupun non-pekerjaan ducting dan pekerjaan metal lebaran yang dilakukan secara terintegrasi elektrik, ventilasi, lemari pendingin, atau peralatan AC, dari pekerjaan tersebut', 0),
(23, 'MK002', '8', 'Jasa Pelaksana konstruksi Pemasangan Pipa Air (Plumbing) dalam Bangunan dan Salurannya', 'Pekerjaan pelaksana pemasangan dan perawatan yang meliputi: 1.   sistem perpipaan utama air panas dan dingin, instalasi sprinkler, pipa air kotor, pipa drain; 2.   perlengkapan saniter; dan 3.   sistem pemadam kebakaran.', 0),
(24, 'MK003', '8', 'Jasa Pelaksana Konstruksi Pemasangan Pipa Gas dalam Bangunan', 'Pekerjaan pelaksana pemasangan dan perawatan pipa untuk  gas, oksigen di rumah sakit dan peralatan pengoperasian gas lainnya', 0),
(25, 'MK004', '8', 'Jasa Pelaksana Konstruksi Insulasi dalam Bangunan', 'Pekerjaan pelaksana pemasangan dan perawatan yang meliputi: 1.   insulasi thermal termasuk bahan isolasi penahan panas untuk dinding luar; 2.   insulasi  thermal  untuk  pipa air panas  dan dingin, ketel  uap dan saluran pembuangan; 3.   insulasi suara; dan 4.   insulasi anti kebakaran.', 0),
(26, 'MK005', '8', 'Jasa Pelaksana Konstruksi Pemasangan Lift dan Tangga Berjalan', 'Pekerjaan konstruksi pemasangan lift dan eskalator serta jalan pejalan kaki yang dapat bergerak juga termasuk pekerjaan konstruksi  perlengkapan keselamatan dari kebakaran (contohnya tangga darurat).', 0),
(27, 'MK006', '8', 'Jasa Pelaksana Konstruksi Pertambangan dan Manufaktur', 'Pekerjaan  pelaksana  pemasangan  dan  perawatan  fasilitas  pertambangan  dan manufaktur termasuk seperti loading and discharging stations, winding shafts, chemical plants,iron foundaries, blast furnaces dan coke oven.', 0),
(28, 'MK007', '8', 'Jasa Pelaksana instalasi thermal, bertekanan, minyak, gas, geothermal (pekerjaan rekayasa)', 'Pekerjaan pelaksana pemasangan dan perawatan dari: 1.   anjungan lepas pantai (platform); dan 2.   fasilitas produksi, penyimpanan minyak dan gas lainnya.', 0),
(29, 'MK008', '8', 'Jasa pelaksana instalasi alat angkut dan alat angkat', 'Pekerjaan pelaksana pemasangan dan perawatan dari konstruksi alat angkut dan angkat serta conveyor.', 0),
(30, 'MK009', '8', 'Jasa Pelaksana Konstruksi Instalasi Perpipaan, Gas, Energi (Pekerjaan Rekayasa)', 'Pekerjaan pelaksana pemasangan dan perawatan dari: 1.   pipa minyak, gas dan energi di darat; dan 2.   pipa minyak, gas dan energi di bawah laut.', 0),
(31, 'MK010', '8', 'Jasa pelaksana instalasi fasilitas produksi, penyimpanan minyak dan gas (pekerjaan rekayasa)', 'Pekerjaan pelaksana pemasangan dan perawatan dari: 1.   fabrikasi fasilitas produksi, penyimpanan minyak dan gas didarat dan lepas pantai; 2.   fabrikasi bejana tekan (pressure vessel) dan tangki; 3.   fabrikasi boiler; dan 4.   fabrikasi module.', 0),
(32, 'EL001', '9', 'Jasa Pelaksana Konstruksi Instalasi Pembangkit Tenaga Listrik Semua Daya', 'Pekerjaan pemasangan dan perawatan elektromekanik dan kelistrikan pembangkit tenaga listrik semua daya.', 0),
(33, 'EL002', '9', 'Jasa Pelaksana Instalasi Pembangkit Tenaga Listrik daya maksimum 10 MW', 'Jasa  pelaksana  instalasi  dan  perawatan  elektromekanik  dan  instalasi  kelistrikan pembangkit tenaga listrik dengan daya maksimum 10 MW / unit.', 0),
(34, 'EL003', '9', 'Jasa Pelaksana Instalasi Pembangkit Tenaga Listrik Energi Baru dan Terbarukan', 'Jasa pelaksana instalasi dan perawatan pembangkit tenaga listrik energi baru dan terbarukan antara lain : surya, angin (bayu), micro hydro, gelombang laut.', 0),
(35, 'EL004', '9', 'Jasa Pelaksana Instalasi Jaringan Transmisi Tenaga Listrik Tegangan Tinggi/Ekstra Tegangan Tinggi', '1.   Jasa pelaksana instalasi dan perawatan jaringan transmisi tenaga listrik tegangan tinggi / ektra tegangan tinggi termasuk instalasi gardu induk; dan 2.   Jasa pelaksana instalasi dan perawatan jaringan transmisi tenaga listrik dibawah atau diatas tanah dan dibawah lautan.', 0),
(36, 'EL005', '9', 'Jasa Pelaksana Konstruksi Jaringan Transmisi Telekomunikasi dan/atau Telepon', '1.   Jasa pelaksana instalasi dan perawatan jaringan transmisi telekomunikasi dan atau  telepon  diatas  permukaan  tanah,  termasuk  pekerjaan  untuk  menara transmisi telekomunikasi; dan 2.   Jasa pelaksana instalasi dan perawatan jaringan transmisi telekomunikasi dan atau telepon dibawah tanah atau dibawah lautan.', 0),
(37, 'EL006', '9', 'Jasa Pelaksana Konstruksi Jaringan Distribusi Tenaga Listrik Tegangan Menengah', 'Jasa pelaksana instalasi dan perawatan jaringan distribusi tenaga listrik tegangan menengah, termasuk untuk jalur listrik kereta api, instalasi listrik gardu hubung dan gardu-gardu distribusi.', 0),
(38, 'EL007', '9', 'Jasa Pelaksana Instalasi Jaringan Distribusi Tenaga Listrik Tegangan Rendah', 'Jasa pelaksana instalasi dan perawatan jaringan distribusi tenaga listrik tegangan rendah dan penerangan jalan umum.', 0),
(39, 'EL008', '9', 'Jasa pelaksana instalasi jaringan distribusi telekomunikasi dan/atau telepon', '1.   Jasa pelaksana instalasi dan perawatan jaringan distribusi telekomunikasi dan/atau telepon termasuk jasa pelaksana untuk menara distribusi telekomunikasi; 2.   Jasa Pelaksana instalasi dan perawatan stasiun telekomunikasi dan antena untuk distribusi telekomunikasi; dan 3.   Jasa Pelaksana instalasi dan perawatan untuk jalur kabel televise untuk dibawah permukaan tanah.', 0),
(40, 'EL009', '9', 'Jasa Pelaksana instalasi Sistem Kontrol dan Instrumentasi', 'Jasa pelaksana pemasangan instalasi kontrol dan instrumentasi untuk sistem pengendali tenaga listrik.', 0),
(41, 'EL010', '9', 'Jasa Pelaksana Instalasi Tenaga Listrik Gedung dan Pabrik', '1.   Jasa pelaksanan instalasi dan perawatan listrik di dalam dan diluar gedung, pabrik maupun jaringan konstruksi; 2.   Jasa pelaksana instalasi dan perawatan listrik dan peralatan untuk sistem tenaga listrik darurat; 3.   Jasa pelaksana instalasi dan perawatan alat pembatas daya listrik dan meteran listrik; 4.   Jasa pelaksana instalasi dan perawatan alarm kebakaran; 5.   Jasa pelaksana instalasi dan perawatan alarm pencurian; 6.   Jasa pelaksana instalasi dan perawatan antena segala Macam type antena termasuk antena satelit dan jalur televisi kabel didalam gedung; 7.   Jasa pelaksana instalasi dan perawatan penangkal petir; dan 8.  Jasa pelaksana instalasi dan perawatan listrik Khusus seperti instalasi listrik kapal, instalasi Listrik tahan api dan sejenisnya.', 0),
(42, 'EL011', '9', 'Jasa Pelaksana Konstruksi Instalasi Elektrikal Lainnya', 'Jasa pelaksana pemasangan dan perawatan untuk sistem penerangan dan tanda untuk jalan, rel kereta api, bandara, pelabuhan dan sejenis.', 0),
(43, 'PL001', '10', 'Jasa Penyewaan Alat Konstruksi Dan Pembongkaran Bangunan Atau Pekerjaan Sipil Lainnya Dengan Operator ', 'Jasa  peminjaman  dan  penyewaan  yang  berhubungan  dengan  peralatan dengan operator untuk konstruksi atau penghancuran dan jasa operasional yang disediakan dengan operator.', 0),
(44, 'PL002', '10', 'Jasa Pelaksana Perakitan dan Pemasangan Konstruksi Prafabrikasi untuk Konstruksi Bangunan Gedung', 'Pekerjaan  khusus  pemasangan  bangunan  konstruksi  prafabrikasi  yang langsung dilakukan di lokasi konstruksi yang bahan utamanya dari beton untuk beberapa   bagian   pracetak   dari   bangunan   gedung   kecuali   pekerjaan pemasangan komponen pracetak baja.', 0),
(45, 'PL003', '10', 'Jasa Pelaksana Perakitan dan Pemasangan Konstruksi Prafabrikasi untuk Konstruksi Jalan dan Jembatan Serta Rel Kereta Api', 'Pekerjaan  khusus  pemasangan  bangunan  konstruksi  prafabrikasi  yang langsung dilakukan di lokasi konstruksi yang bahan utamanya dari beton untuk beberapa bagian pracetak dari konstruksi jalan, jembatan dan rel kereta api kecuali pekerjaan pemasangan komponen pracetak baja.', 0),
(46, 'PL004', '10', 'Jasa Pelaksana Perakitan dan Pemasangan Konstruksi Prafabrikasi untuk Konstruksi Prasarana Sumber Daya Air, Irigasi, Dermaga, Pelabuhan, Persungaian, Pantai serta Bangunan Pengolahan Air Bersih, Limbah dan Sampah(Insinerator)', 'Pekerjaan  khusus  pemasangan  bangunan  konstruksi  prafabrikasi  yang langsung  dilakukan dilokasi  konstruksi   yang  bahan  utamanya dari  beton untuk beberapa bagian pracetak dari konstruksi prasarana sumber daya air, irigasi, dermaga, pelabuhan, persungaian, pantai serta bangunan pengolahan air bersih dan limbah, kecuali pekerjaan pemasangan komponen pracetak baja.', 0),
(47, 'SP001', '16', 'Pekerjaan Penyelidikan Lapangan', 'Pekerjaan penyelidikan lapangan bertujuan mengidentifikasi lokasi yang tepat untuk proyek konstruksidan untuk pekerjaan demarkasi, contohnya demarkasi dari suatu area lokal dimana satu atau lebih tahapan atau proses besar dari pekerjaan konstruksi sedang berjalan.', 0),
(48, 'SP002', '16', 'Pekerjaan Pembongkaran', 'Pekerjaan penghancuran bangunan atau struktur lainnya seperti jalan dan jalan layang, mencakup juga penjualan material yang didapat dari hasil operasi penghancuran.', 0),
(49, 'SP003', '16', 'Pekerjaan Penyiapan dan Pematangan Tanah / Lokasi', 'Pekerjaan penyiapan yang bertujuan agar lahan siap untuk dipergunakan untuk pekerjaan konstruksi selanjutnya, termasuk didalamnya blasting,testdrilling, dan pekerjaan pemindahan batu-batuan', 0),
(50, 'SP004', '16', 'Pekerjaan Tanah, Galian dan Timbunan', 'Pekerjaan  penggalian  dan  penimbunan,  pekerjaan  pemindahan  tanah, grading of construction sites, trench digging.', 0),
(51, 'SP005', '16', 'Pekerjaan Persiapan Lapangan untuk Pertambangan', 'Pekerjaan   terowongan   dan   pembangunan   lainnya   serta   pekerjaan persiapan untuk properti mineral dan situsnya, kecuali untuk minyak dan gas.  Contohnya  pelayanan  insidental  konstruksi  untuk  pertambangan minyak dan gas', 0),
(52, 'SP006', '16', 'Pekerjaan Perancah', 'Pemasangan perancah bangunan dan pekerjaan dismantling.', 0),
(53, 'SP007', '16', 'Pekerjaan Pondasi, Termasuk Pemancangannya', 'Pekerjaan  konstruksi  khusus  pondasi  dan  pekerjaan  pile  driving  serta pekerjaan lain yang berkaitan.', 0),
(54, 'SP008', '16', 'Pekerjaan Pengeboran Sumur Air Tanah Dalam.', 'Pekerjaan konstruksi khusus yang melibatkan pengeboran dan penggalian sumber air, instalasi dan pekerjaan perbaikan dari pompa sumur dan sistem pemipaan.', 0),
(55, 'SP009', '16', 'Pekerjaan Atap dan Kedap Air (waterproofing)', 'Pekerjaan konstruksi khusus yang melibatkan instalasi atap, guttering dan spouting, roof shingling dan pekerjaan atap metal. Pekerjaan pengecatan atap, termasuk didalamnya pekerjaan water-proofing untuk bangunan.', 0),
(56, 'SP010', '16', 'Pekerjaan Beton', 'Pekerjaan konstruksi khusus yang melibatkan pembetonan, concrete pouring dan pekerjaan concrete lainnya termasuk didalamnya aspal dan semen portland pada proyek konstruksi', 0),
(57, 'SP011', '16', 'Pekerjaan Baja dan Pemasangannya, Termasuk Pengelasan', 'Pekerjaan  konstruksi  khusus  yang  meliputi  penekukan  baja,  pekerjaan konstruksi terhadap rangka baja, pekerjaan pemasangan komponen baja untuk bangunan ataupun untuk struktur lain seperti jembatan, crane yang bekerja   pada   ketinggian,  menara   transmisi  listrik   serta   pekerjaan reinforcing baja baik yang dibeli atau diproduksi sendiri  termasuk juga pekerjaan pengelasan baja.', 0),
(58, 'SP012', '16', 'Pekerjaan Pemasangan Batu', 'Pekerjaan  konstruksi  khusus  yang  melibatkan  pemasangan  blok  batu, pengesetan batu dan pekerjaan batu lainnya.', 0),
(59, 'SP013', '16', 'Pekerjaan Konstruksi Khusus Lainnya', 'Pekerjaankonstruksikhusus   lain    seperti    penggalian   kuburan   dan perpindahan rumah.', 0),
(60, 'SP014', '16', 'Pekerjaan Pengaspalan dengan Rangkaian Peralatan Khusus', 'Pekerjaan Pengaspalan dengan menggunakan peralatan produksi campuran aspal termasuk transportasi hasil campuran aspal hingga penggelaran dan pemadatan dengan peralatan khusus di lokasi pekerjaan.', 0),
(61, 'SP015', '16', 'Pekerjaan Lansekap/Pertamanan', 'Pekerjaan khusus pembuatan taman, seperti taman kota, tanaman dan pohon pelindung jalan.', 0),
(62, 'SP016', '16', 'Pekerjaan Perawatan Bangunan Gedung', 'Pekerjaan pemeliharaan bangunan gedung, tidak termasuk pekerjaan yang melakukan perubahan terhadap struktur bangunan.', 0),
(63, 'KT001', '12', 'Pekerjaan Kaca dan Pemasangan Kaca Jendela', 'Pekerjaan konstruksi khusus material kaca, cermin, dan produk-produk berbahan kaca, serta pekerjaan instalasi jendela kaca.', 0),
(64, 'KT002', '12', 'Pekerjaan Plesteran', 'Pekerjaan  konstruksi  khususdari  plester  interior  dan  exterior  ataustucco  dan pekerjaan  dry  wall  yang  berhubungan deingan instalasi  dinding  papan, yang biasanya adalah bahan gypsum.', 0),
(65, 'KT003', '12', 'Pekerjaan Pengecatan', 'Pekerjaan  konstruksi  khusus  pengecatan  dan  pekerjaan  konstruksi  yang berhubungan dengan interior dan exterior bangunan dan pekerjaan pengecatan dari struktur berat (rekayasa teknik). Tidak termasuk pengecatan atap bangunan.', 0),
(66, 'KT004', '12', 'Pekerjaan Pemasangan Keramik Lantai dan Dinding', 'Pekerjaan konstruksi khusus pemasangan dan pegesetan keramik, dinding beton, dinding potongan batu, serta lantai ubin.', 0),
(67, 'KT005', '12', 'Pekerjaan Pemasangan Lantai Lain, Penutupan Dinding dan Pemasangan Wall paper', 'Pekerjaan konstruksi  khusus pemasangan karpet,  linoleum, ubin aspal, lantai elastis, parquet, dan lantai berbahan kayu keras lainnya.', 0),
(68, 'KT006', '12', 'Pekerjaan Kayu dan atau penyambungan Kayu dan Material Lain', 'Pekerjaan konstruksi khusus yang berhubungan dengan pekerjaan pengrajin kayu, pembentukan bentuk kayudanpemasanganlemari di lokasi konstruksi.', 0),
(69, 'KT007', '12', 'Pekerjaan Dekorasi dan Pemasangan Interior', 'Pekerjaan konstruksi khusus pemasangan terazzo, interior marbel, granit dan pekerjaan batu tulis.', 0),
(70, 'KT008', '12', 'Pekerjaan Pemasangan Ornamen', 'Pekerjaan konstruksi khusus untuk komponen logam lembaran fabrikasi khusus, pekerjaan  dekorasi  besi  dan  baja, serta  pengerjaan ornament dan  arsitektur logam.', 0),
(71, 'KT009', '12', 'Pekerjaan Pemasangan Gipsum', 'Pekerjaan konstruksi khusus untuk komponen panel gypsum seperti pemasangan dinding  partisi  dalam  bangunan  gedung  yang  menggunakan  panel  gypsum, pemasangan plafon dalam bangunan gedung yang menggunakan panel gypsum.', 0),
(72, 'KT010', '12', 'Pekerjaan Pemasangan plafon akustik (accoustic ceiling)', 'Pekerjaan konstruksi khusus untuk pemasangan plafon akustik pada ruangan di dalam bangunan gedung. Bahan penutup plafond akustik berbentuk panel yang diletakkan atau dijepit pada rangka metal yang bentuk grid (kotak-kotak).', 0),
(73, 'KT011', '12', 'Pemasangan curtain wall', 'Pekerjaan  konstruksi  khusus  untuk  menutup  sisi sisi  bagian  luar  gedung bertingkat.  Bahan  penutup  bangunan  merupakan  bahan  non  struktural  dan ringan, yang berfungsi sebagai pemisah antara bagian dalam dan luar gedung. Pemasangan  curtain  wall  padaumumnya  terdiri  dari  rangka  allumunium  danbahan  penutup  berupa  kaca,  panel  metal  atau  GRC  (Glassfibre  Reinforce Concrete).', 0),
(74, 'TI501', '11', 'Jasa Terintegrasi Untuk Infrastruktrur Tranportasi', 'Jasa teknikal terintegrasi untuk konstruksi dari infrastruktur transportasi (turnkey projects). Termasuk didalamnya perencanaan dan studi sebelum investasi, pembuatan pre-elimary dan final desain, estimasi biaya, penjadwal konstruksi, inspeksi dan penerimaan dari kontrak termasuk jasa teknikal seperti seleksi dan pelatihan personiil dan operasional dan pembuatan manual pemiliharaan dan jasa teknikal lainnya yang disediakan untuk klient yang membentuk jasa terintegrasi utuh untuk proyek terima jadi termasuk didalamnya kegiatan yang dilakukan secara   terintegrasi   antara   perencanaan,   pengadaan,   dan   pelaksanaan   terima   jadi (engineering, procurement, construction)', 0),
(75, 'TI502', '11', 'Jasa Terintegrasi Untuk Konstruksi Penyaluran Air dan Pekerjaan Sanitasi', 'Jasa teknikal terintegrasi untuk konstruksi dari infrastruktur keairan dan sanitasi.  Termasuk didalamnya perencanaan dan studi sebelum investasi, pembuatan pre-elimary dan   final desain, estimasi biaya, penjadwal konstruksi, inspeksi dan penerimaan dari kontrak termasuk jasa teknikal seperti seleksi dan pelatihan personiil dan operasional dan pembuatan manual pemiliharaan dan jasa teknikal lainnya yang disediakan untuk klient yang membentuk jasa terintegrasi utuh untuk proyek terima jadi termasuk didalamnya kegiatan yang dilakukan secara   terintegrasi   antara   perencanaan,   pengadaan,   dan   pelaksanaan   terima   jadi (engineering, procurement, construction)', 0),
(76, 'TI503', '11', 'Jasa Terintegrasi Untuk Konstruksi Manufaktur', 'Jasa teknikal terintegrasi untuk konstruksi dari fasilitas manufaktur.  Termasuk didalamnya perencanaan dan studi sebelum investasi, pembuatan pre-elimary dan  final desain, estimasi biaya, penjadwal konstruksi, inspeksi dan penerimaan dari kontrak termasuk jasa teknikal seperti seleksi dan pelatihan personiil dan operasional dan pembuatan manual pemiliharaan dan jasa teknikal lainnya yang disediakan untuk klient yang membentuk jasa terintegrasi utuh untuk proyek terima jadi termasuk didalamnya kegiatan yang dilakukan secara terintegrasi antara perencanaan, pengadaan, dan pelaksanaan terima jadi (engineering, procurement, construction)', 0),
(77, 'TI504', '11', 'Jasa Terintegrasi Untuk Konstruksi Fasilitas Minyak dan Gas', 'Jasa  Konsultansi  Terintegrasi  Untuk  Konstruksi  Fasilitas  Minyak  dan  Gas.    Termasuk didalamnya perencanaan dan studi sebelum investasi, pembuatan pre-elimary dan   final desain, estimasi biaya, penjadwal konstruksi, inspeksi dan penerimaan dari kontrak termasuk jasa teknikal seperti seleksi dan pelatihan personiil dan operasional dan pembuatan manual pemiliharaan dan jasa teknikal lainnya yang disediakan untuk klient yang membentuk jasa terintegrasi utuh untuk proyek terima jadi termasuk didalamnya kegiatan yang dilakukan secara   terintegrasi   antara   perencanaan,   pengadaan,   dan   pelaksanaan   terima   jadi (engineering, procurement, construction)', 0),
(78, 'AR101', '1', 'Jasa Nasihat dan Pra Desain Arsitektural', 'Jasa asistensi, nasehat, dan rekomendasi mengenai arsitektural dan hal-hal yang terkait   dengan   arsitektural.   Termasuk   didalamnya   melaksanakan   kajian pendahuluan tentang  isu-isu seperti site  philosopi, tujuan dari  pembangunan, tinjauan lingkungan dan iklim, kebutuhan hunian, batasan biaya, analisa pemilihan lokasi, penjadwalan pelaksanaan konstruksi, dan isu lain yang  mempengaruhi desain dan konstruksi dari suatu proyek. Jasa ini meliputi tidak hanya proyek konstruksi yang baru namun dapat meliputi nasihat mengenai metode dalam melaksanakan perawatan, renovasi, restorasi, atau recycling dari bangunan, atau penentuan nilai dan kualitas dari bangunan atau nasihat arsitektural lainnya.', 0),
(79, 'AR102', '1', 'Jasa Desain Arsitektural', 'Jasa Desain Arsitektural           atau kombinasi dari kegiatan sebagai berikut:  1.   Jasa  desain  skematik  yang  meliputi  penentuan  (bersama  dengan  klien) batasan anggaran dan penjadwalan waktu; serta menyiapkan sketsa  yang meliputi floor plans, site plans, dan exterior views; 2.   Jasa desain pembangunan yang meliputi ilustrasi presisi dari konsep desain dalam hal siting plan, bentuk dan material yang akan digunakan, struktur, sistem mekanikal dan elektrikal, dan kemungkinan biaya konstruksi; dan 3.   Jasa desain akhir yang meliputi spesifikasi tertulis dan gambar yang cocok untuk digunakan sebagai detail dari pelaksanaan tender dan konstruksi, dan juga nasihat ahli kepada klien pada saat evaluasi tender.', 0),
(80, 'AR103', '1', 'Jasa Penilai Perawatan dan Kelayakan Bangunan Gedung', 'Jasa  penelitian,  nasehat  dan  rekomendasi  yang  berkaitan  dengan  masalah arsitektural dan hal berikut: 1.   cara untuk melaksanakan pemeliharaan bangunan, renovasi gedung, dan jasa restorasi bangunan gedung; 2.   penilaian kelayakan bangunan gedung termasuk juga didalamnya bangunan yang terkena musibah kebakaran; 3.   tata cara penilaian usia bangunan; dan 4.   tatacara pembongkaran (demolisi) bangunan gedung Tidak berkaitan dengan proyek konstruksi baru dan penambahan bangunan baru.', 0),
(81, 'AR104', '1', 'Jasa Desain Interior', '1.  Jasa desain interior seperti perencanaan dan perancangan ruangan interior untuk kebutuhan fisik, estetik dan fungsi; 2.  Penggambaran desain untuk dekorasi interior; dan 3.  Dekorasi interior termasuk penyempurnaan jendela dan gudang.', 0),
(82, 'AR105', '1', 'Jasa Arsitektur lainnya', 'Semua jasa yang membutuhkan keahlian arsitek seperti penyiapan promotional material  dan  presentasi  serta  as  built  drawings.  Termasuk  juga  sebagai representasi lapangan saat fase konstruksi, pembuatan manual operasi dan lain sebagainya.', 0),
(83, 'RE101', '2', 'Jasa Nasehat dan Konsultansi Rekayasa Teknik', 'Rekomendasi, nasihat dan asistensi mengenai rekayasa teknik, termasuk didalamnya melaksanakan studi kelayakan dan dampak dari proyek contohnya antara lain: 1.   studi dampak topografi dan geologi dalam desain, konstruksi dan biaya dari jalan, saluran pipa dan infrastruktur transportasi lainnya; 2.   Studi dari kualitas atau kecocokan material yang akan digunakan dalam proyek konstruksi  dan  dampaknya  dalam  desain,  serta  konstruksi  dan  biaya  jika menggunakan material yang berbeda; 3.   Studi dampak lingkungan dari proyek konstruksi; dan 4.   Studi keuntungan efesiensi produksi sebagai dampak dari penggunaan alternatif proses, teknologi dan layout. Ruang lingkup dari jasa ini tidak selalu terkait dengan proyek konstruksi namun dapat juga meliputi penilaian dari struktur bangunan dan instalasi mekanikal dan elektrikal, testimoni ahli dalam kasus litigation serta memberikan asistensi kepada pemerintah dalam penyusunan peraturan perundangan.', 0),
(84, 'RE102', '2', 'Jasa Desain Rekayasa untuk Konstruksi Pondasi serta Struktur Bangunan', 'Jasa  desain  rekayasa  struktur  untukthe  load  bearing  framework  dari  bangunan perumahan dan komersial, bangunan institusi dan industrial. Jasa desain ini meliputi satu atau kombinasi dari kegiatan berikut: 1.   Estimasi biaya, spesifikasi dan rencana pendahuluan untuk mendefinisikan konsep desain teknik; 2.   Rencana akhir, spesifikasi dan estimasi biaya termasuk didalamnya gambar kerja, spesifikasi  material  yang  digunakan,  metode  instalasi,  batasan  waktu  dan spesifikasi yang dibutuhkan untuk keperluan tender dan konstruksi serta nasihat ahli untuk klient pada saat evaluasi dan penerimaan tender; dan 3.   Jasa yang diberikan pada saat fase konstruksi.', 0),
(85, 'RE103', '2', 'Jasa Desain Rekayasa untuk Pekerjaan Teknik Sipil Air', 'Jasa pembuatan desain rekayasa (engineering) untuk pekerjaan rekayasa sipil keairan seperti    dam,  catchment  basins,  sistem  irigasi,  pekerjaan  pengendalian  banjir, pelabuhan, pekerjaan penyaluran air dan sanitasi serta sistem saluran air limbah industri. Jasa Desain meliputi salah satu dari kombinasi layanan berikut: perencanaan awal, estimasi biaya dan spesifikasi dalam rangka menterjemahkan konsep desain teknis; perencanaan akhir, estimasi biaya dan spesifikasi termasuk gambar teknik, spesifikasi material yang akan digunakan, metode pemasangan, batasan waktu dan spesifikasi teknis lainnya yang dibutuhkan untuk keperluan tender; layanan pada saat fase konstruksi.', 0),
(86, 'RE104', '2', 'Jasa Desain Rekayasa untuk Pekerjaan Teknik Sipil Transportasi', 'Jasa pembuatan desain rekayasa (engineering) untuk pekerjaan rekayasa sipil transportasi seperti  jembatan,  jalan  layang,  dan  jalan  raya.  Jasa  Desain  meliputi  salah  satu  dari kombinasi layanan berikut: perencanaan awal, estimasi biaya dan spesifikasi dalam rangka menterjemahkan konsep desain teknis, perencanaan akhir, estimasi biaya dan spesifikasi termasuk gambar teknik, spesifikasi material yang akan digunakan, metode pemasangan, batasan waktu dan spesifikasi teknis lainnya yang dibutuhkan untuk keperluan tender layanan pada saat fase konstruksi.Termasuk didalamnya jasa pembuatan desain structural health monitoring system untuk bentang jembatan.', 0),
(87, 'RE105', '2', 'Jasa Desain Rekayasa untuk Pekerjaan Mekanikal dan Elektrikal Dalam Bangunan', 'Jasa  pembuatan  desain  rekayasa  (engineering)  mekanikal  dan  elektrikal  untuk  sistem energi, sistem penerangan, sistem alarm kebakaran, sistem komunikasi dan sistem eletrikal lainnya  untuk  semua  jenis  bangunan  dan  atau  sistem  pemanas  ruangan,  ventilasi, pendingin ruangan lemari pendingin dan pemasangan mekanikal lainnya untuk semua jenis bangunan.  Jasa Desain meliputi salah satu dari kombinasi layanan berikut : perencanaan awal, estimasi biaya dan spesifikasi dalam rangka menterjemahkan konsep desain teknis; perencanaan akhir, estimasi  biaya  dan spesifikasi  termasuk  gambar teknik, spesifikasi material yang akan digunakan, metode pemasangan, batasan waktu dan spesifikasi teknis lainnya yang dibutuhkan untuk keperluan tender  layanan pada saat fase konstruksi.', 0),
(88, 'RE106', '2', 'Jasa Desain Rekayasa untuk Proses Industrial dan Produksi', 'Jasa  desain  teknik  untuk  proses  produksi,  prosedur  dan  fasilitas  produksi.  Termasuk didalamnya  jasa  desain  yang  berkaitan  dengan  metode  pemotongan,  handling  dan transportasi logistik dan layout lokasi antara lain layout pembangunan pertambangan dan konstruksi bawah tanah, gabungan pelaksanaan sipil, instalasi mekanikal dan elektrikal lokasi  pertambangan  bawah  tanah  termasuk  didalamnya  hoists,  kompresor,  stasiun pompa, crushers, conveyor dan sistem handling limbah, prosedur recovery dari minyak dan gas, konstruksi, instalasi dan perawatan dari peralatan pengeboran, fasilitas penyimpanan . Jasa desain meliputi satu atau kombinasi dari beberapa kegiatan antara lain: 1.   Estimasi biaya, spesifikasi dan rencana pendahuluan untuk mendefinisikan konsep desain teknik; 2.   Rencana akhir, spesifikasi dan estimasi biaya termasuk didalamnya gambar kerja, spesifikasi material yang digunakan, metode instalasi, batasan waktu dan spesifikasi yang dibutuhkan untuk keperluan tender dan konstruksi serta nasihat ahli untuk klien pada saat evaluasi dan penerimaan tender; dan 3.   Jasa yang diberikan saat fase konstruksi.', 0),
(89, 'RE107', '2', 'Jasa Nasehat dan Konsultansi Jasa Rekayasa Konstruksi', 'Jasa konsultansi di bidang jasa konstruksi yang meliputi jasa nasihat dalam pembinaan usaha dan kelembagaan, pembinaan penyelenggaraan dan pembinaan investasi konstruksi serta pembinaan kompetensi dan keahlian Tenaga Kerja Konstruksi oleh Pemerintah baik Pemerintah Pusat maupun Pemerintah Daerah. Termasuk jasa penelitian dan pengembangan bidang konstruksi.', 0),
(90, 'RE108', '2', 'Jasa Desain Rekayasa Lainnya', 'Jasa desain rekayasa khusus lainnya. Termasuk desain rekayasa akustik dan vibrasi, sistem pengendalian lalu-lintas, pengembangan prototype dan desain detail dari produk baru serta jasa desain rekayasa khusus lainnya.', 0),
(91, 'PR101', '3', 'Jasa Perencanaan dan Perancangan Perkotaan', 'Jasa perencanaan tata ruang (mencakup darat, laut, udara, dan di dalam bumi) perkotaan,jasa perancangan bagian perkotaan, termasuk juga jasa pengkajian dan jasa penasehatandalam penataan ruang perkotaan.', 0),
(92, 'PR102', '3', 'Jasa Perencanaan Wilayah', 'Jasa perencanaan tata ruang (mencakup darat, laut, udara, dan di dalam bumi) wilayahnasional,  pulau,  provinsi,  kabupaten,  dan  kota,  termasuk  juga  jasa pengkajian   dan   jasapenasehatan   dalam   penataan   ruang   wilayah   yang didalamnya   dapat  meliputi   kawasan   koridor   pulau,  kawasan   strategis nasional/provinsi/kabupaten/kota,kawasan andalan, dan kawasan permukiman termasuk ruang terbuka publik/terbuka hijau.', 0),
(93, 'PR103', '3', 'Jasa Perencanaan dan Perancangan lingkungan bangunan dan lansekap', 'Jasa pembuatan desain dan rencana dari aesthetic landscaping untuk taman, lahan komersial dan permukiman. Meliputi penyiapan rencana lapangan, gambar kerja, spesifikasi dan estimasi biaya untuk pengembangan lahan yang menggambarkan konturtanah, tanaman yang akan ditanam, dan fasilitas lain seperti tempat pejalan kaki, pagar, dan area parkir. Termasuk juga didalamnya jasa inspeksi dari pekerjaan selama konstruksi, jasa pengkajian dan penasehatan penataan lingkungan bangunan dan lansekap.', 0),
(94, 'PR104', '3', 'Jasa Pengembangan Pemanfaatan Ruang', 'Jasa  perumusan  kebijakan  strategis  operasionalisasi  rencana  tata  ruang (mencakup  darat,laut,  udara,  dan  di  dalam  bumi),  jasa  pemrograman pemanfaatan ruang perkotaan, wilayah,kawasan/lingkungan, termasuk juga jasa manajemen mitigasi dan adaptasi bencana dankerusakan lingkungan, fasilitasi kemitraan dan pelembagaan dalam penyelenggaraanpenataan ruang.', 0),
(95, 'AR201', '13', 'Jasa Pengawas Administrasi Kontrak', 'Jasa  asistensi  teknis  dan  nasihat  selama  fase  konstruksi  untuk  memastikan struktur terbangun sama dengan gambar teknis final beserta spesifikasinya. Jasa ini meliputi jasa yang disediakan baik di kantor maupun di lapangan seperti inspeksi teknis konstruksi, penyiapan laporan kemajuan, penerbitan sertifikat untuk pembayaran ke penyedia jasa pelaksana konstruksi, memberikan panduan kepada penyedia jasa dan/atau pengguna jasa dalam hal interpretasi terhadap dokumen kontrak  dan jasa nasihat lain dalam  aspek  teknikal selama proses konstruksi.Termasuk  didalamnya  juga  jasa  yang  diberikan  setelah  selesainya proses konstruksi yang meliputi penilaian pada konstruksi dan instruksi mengenai koreksi  pengukuran  yang  harus  dilakukan  selama  periode  12  bulan  setelah selesainya proses konstruksi.', 0),
(96, 'RE201', '14', 'Jasa Pengawas Pekerjaan Konstruksi Bangunan Gedung', 'jasa asistensi teknis dan nasihat selama fase pelaksanaan konstruksi bangunan gedung untuk memastikan pekerjaan konstruksi yang sedang dilaksanakan sudah sesuai dengan final desain. Meliputi jasa yang diberikan di kantor maupun di lapangan seperti pengkajian shop drawings, kunjungan secara periodik ke lapangan untuk mengukur progress dan kualitas pekerjaan, memberikan panduan kepada klien dan   penyedia jasa pelaksana konstruksi  dalam  menginterpretasikan  dokumen  kontrak  dan  nasihat  lain  dalam  hal teknikal selama proses kontruksi bangunan gedung.', 0),
(97, 'RE202', '14', 'Jasa Pengawas Pekerjaan Konstruksi Teknik Sipil Transportasi', 'jasa asistensi teknis dan nasihat selama fase pelaksanaan konstruksi infrastruktur sipil transportasi seperti jalan raya, jembatan, jalan bebas hambatan dan sebagainya untuk memastikan  pekerjaan konstruksi yang sedang dilaksanakan sudah sesuai dengan final desain. Meliputi jasa yang diberikan di kantor maupun di lapangan seperti pengkajian shop drawings, kunjungan secara periodik kelapangan untuk mengukur progress dan kualitas pekerjaan,    memberikan    panduan    kepada    klient    dan    kontraktor    dalam menginterpretasikan dokumen kontrak dan nasihat lain dalam hal teknikal selama proses kontruksi infrastruktur sipil transportasi.', 0),
(98, 'RE203', '14', 'Jasa Pengawas Pekerjaan Konstruksi Teknik Sipil Air', 'jasa asistensi teknis dan nasihat selama fase pelaksanaan konstruksi infrastruktur sipil keairan  seperti  dam, catchment basins, sistem irigasi, pekerjaan pengendalian banjir, pelabuhan, pekerjaan penyaluran air dan sanitasi serta sistem saluran air limbah industri, untuk memastikan  pekerjaan konstruksi yang sedang dilaksanakan sudah sesuai dengan final  desain  .  Meliputi  jasa  yang  diberikan  di  kantor  maupun  di  lapangan  seperti pengkajian  shop  drawings,  kunjungan  secara  periodik  kelapangan  untuk  mengukur progres dan kualitas pekerjaan, memberikan panduan kepada klient dan kontraktor dalam menginterpretasikan dokumen kontrak dan nasihat lain dalam hal teknikal selama proses kontruksi infrastruktur sipil keairan.', 0),
(99, 'RE204', '14', 'Jasa Pengawas Pekerjaan Konstruksi dan Instalasi Proses dan Fasilitas Industri', 'jasa asistensi teknis dan nasihat selama fase pelaksanaan konstruksi dan instalasi proses dan fasilitas industri untuk memastikan  pekerjaan konstruksi yang sedang dilaksanakan sudah sesuai dengan final desain, meliputi kunjungan secara periodik kelapangan untuk mengukur progres dan kualitas pekerjaan.', 0),
(100, 'PR201', '15', 'Jasa Pengawas dan Pengendali Penataan Ruang', 'Jasa   pengawasan   teknis   penyelenggaraan   penataan   ruang,   jasa   audit pemanfaatan ruang,dan pengaturan zonasi, termasuk juga jasa pengkajian dan penasehatan dalampengawasan dan pengendalian penataan ruang.', 0),
(101, 'SP301', '5', 'Jasa Pembuatan Prospektus Geologi dan Geofisika', 'Jasa konsultansi geologi, geofisika dan geo kimia yang berhubungan dengan kandungan mineral, minyak dan gas serta air bawah tanah dengan melakukan studi parameter terhadap bumi dan formasi batu dan struktur.', 0),
(102, 'SP302', '5', 'Jasa Survey bawah Tanah', 'Jasa  pengambilan  data  pada  formasi  dibawah  permukaan  bumi  dengan metode  lainnya termasuk  didalamnya pengukuran seismograf, gravimeter, magnetometer, dan metode survey bawah permukaan lainnya.', 0),
(103, 'SP303', '5', 'Jasa Survey Permukaan Tanah', 'Jasa  pengambilan  informasi  dari  bentuk  posisi  dan/atau  lapisan  dari permukaan  bumi  dengan  menggunakan  metode  lain,  termasuk  transit, fotogrameter dan survey hydrograf untuk tujuan persiapan pembuatan peta.', 0),
(104, 'SP304', '5', 'Jasa Pembuatan Peta', 'Terdiri  dari  perisapan  dan  revisi  dari  segala  jenis  peta  (jalan,  cadastral, topografi, dan planimeter).', 0),
(105, 'SP305', '5', 'Jasa Pengujian dan Analisa Komposisi dan Tingkat kemurnian', 'Jasa pengujian dan analisa dari parameter kimia dan biologi material seperti udara, air, dan limbah (limbah rumah tangga dan industri), minyak, metal, mineral dan zat kimia. Termasuk didalamnya jasa pengujian dan analisa yang berhubungan dengan mikrobiologi, biokimiawi, bakteriologi, dan sebagainya.', 0),
(106, 'SP306', '5', 'Jasa Pengujian dan Analisa Parameter fisikal', 'Jasa pengujian dan analisa parameter fisikal seperti kekuatan, keringkihan, konduktivitas  elektriksitas  dan  radioaktivitas  dari  material  seperti  metal, plastik, tekstil, kayu,kaca, beton, dan material lainnya. Termasuk didalamnya pengujian daya tarik, kekerasan, impact resistance, ketahanan fatique, serta efek temperatur tinggi.', 0),
(107, 'SP307', '5', 'Jasa Pengujian dan Analisa Sistem Mekanikal dan Elektrikal', 'Jasa  Pengujian  dan  analisa  dari  karakteristik  permesinan  lengkap,  motor, mobil, peralatan dan penerapan, peralatan komunikasi, dan peralatan lainnya yang berhubungan dengan mekanikal dan elektrikal.', 0),
(108, 'SP308', '5', 'Jasa Inspeksi Teknikal', 'Jasa Pengujian dan Analisa dari teknikalyang tidak mempengaruhi objek yang dilakukan   pengujian,   Termasuk   didalamnya   radiografi,   magnetic,   dan pengujian ultrasonic dari komponen mesin dan struktur yang dilakukan untuk mengidentifikasi cacat produk. Pengujian ini dilakukan langsung di lapangan.', 0),
(109, 'KL401', '4', 'Jasa Konsultansi Lingkungan', 'Jasa konsultansi yang mencakup kegiatan pengolahan air bersih, penyehatan lingkungan permukiman, serta nasihat pengelolaan persampahan.', 0),
(110, 'KL402', '4', 'Jasa Konsultansi Estimasi Nilai Lahan dan Bangunan', 'Jasa konsultansi yang dengan metode tertentu melakukan estimasi terhadap nilai  dari  suatu lahan dan/atau bangunan (baik  bangunan gedung  maupun bangunan sipil). Termasuk didalamnya memberikan rekomendasi perencanaan pembebasan lahan untuk proyek konstruksi.', 0),
(111, 'KL403', '4', 'Jasa Manajemen Proyek Terkait Konstruksi Bangunan', 'Jasa  konstruksi  menyeluruh  di  bidang  sipil  bangunan  gedung  antara  lain bangunan  hunian,  dan  bangunan  bukan  hunian  seperti  bangunan  industri, pertanian dan komersial dimana tanggungjawab atas keberhasilan penyelesaian proyek    atas    nama    pengguna    jasa    (klien),    termasuk    didalamnya pengorganisasian pembiayaan dan desain, undangan tender, dan pelaksanaan manajemen termasuk fungsi-fungsi kontrol.', 0),
(112, 'KL404', '4', 'Jasa Manajemen Proyek Terkait Konstruksi Pekerjaan Teknik Sipil Transportasi', 'Jasa konstruksi menyeluruh di bidang sipil transportasi antara lain jalan bebas hambatan, jalan raya, jalan, jalan kereta api, landasan pacu pesawat, jembatan, jalan layang, terowongan dan jalan bawah tanah, dimana tanggungjawab atas keberhasilan penyelesaian proyek atas nama pengguna jasa (klien), termasuk didalamnya pengorganisasian pembiayaan dan desain, undangan tender, dan pelaksanaan manajemen termasuk fungsi-fungsi kontrol.', 0),
(113, 'KL405', '4', 'Jasa Manajemen Proyek Terkait Konstruksi Pekerjaan Teknik Sipil Keairan', 'Jasa  konstruksi  menyeluruh  di  bidang  sipil  keairan  antara  lain  pelabuhan, saluran air, bendungan, irigasi dan pekerjaan air lainnya dimana tanggungjawab atas  keberhasilan  penyelesaian  proyek  atas  nama  pengguna  jasa  (klien), termasuk  didalamnya  pengorganisasian  pembiayaan  dan  desain,  undangan tender, dan pelaksanaan manajemen termasuk fungsi-fungsi kontrol.', 0),
(114, 'KL406', '4', 'Jasa Manajemen Proyek Terkait Konstruksi Pekerjaan Teknik Sipil Lainnya', 'Jasa konstruksi menyeluruh di bidang sipil lainnya antara lain pemipaan, kabel komunikasi dan listrik, jarak jauh, pemipaan lokal dan kabel dan pekerjaan yang terkait olahraga outdoor dan fasilitas rekreasi dimana tanggungjawab atas keberhasilan penyelesaian proyek atas nama pengguna jasa (klien), termasuk didalamnya pengorganisasian pembiayaan dan desain, undangan tender, dan pelaksanaan manajemen termasuk fungsi-fungsi kontrol.', 0),
(115, 'KL407', '4', 'Jasa Manajemen Proyek Terkait Konstruksi Pekerjaan konstruksi proses dan fasilitas industrial', 'Jasa  konstruksi  menyeluruh  di  bidang  konstruksi  industri  dan  proses  antara  lain pertambangan, konstruksi pembangkit tenaga listrik, kimia dan fasilitas terkait, konstruksi untuk manufaktur, dan otomasi proses industri dimana tanggungjawab atas keberhasilan penyelesaian   proyek   atas   nama   pengguna   jasa   (klien),   termasuk   didalamnya pengorganisasian pembiayaan dan desain, undangan tender, dan pelaksanaan manajemen termasuk fungsi-fungsi kontrol.', 0),
(116, 'KL408', '4', 'Jasa Manajemen Proyek Terkait Konstruksi Pekerjaan Sistem Kendali Lalu Lintas', 'Jasa konstruksi menyeluruh di bidang sistem kontrol lalu lintas antara lain sistem kontrol lalu lintas untuk transportasi darat, udara dan laut dimana tanggungjawab atas keberhasilan penyelesaian   proyek   atas   nama   pengguna   jasa   (klien),   termasuk   didalamnya pengorganisasian pembiayaan dan desain, undangan tender, dan pelaksanaan manajemen termasuk fungsi-fungsi kontrol.', 0),
